CREATE DEFINER=`root`@`localhost` FUNCTION `getTotalLineas` (`numero` INT(111)) RETURNS DECIMAL(20,8) BEGIN
DECLARE contador int;
DECLARE b decimal (20,8);
DECLARE c decimal (20,8);
DECLARE total decimal (20,8);
DECLARE nom int;
DECLARE precio CURSOR FOR SELECT Precio FROM detalles WHERE NumeroFactura=numero;
DECLARE cantidad CURSOR FOR SELECT Cantidad FROM detalles WHERE NumeroFactura=numero;
SET b=0;
SET contador=0;
SET nom=0;
set c=0;
SET total=0;
SELECT COUNT(*) INTO contador FROM detalles WHERE NumeroFactura=numero;

OPEN precio;
OPEN cantidad;

WHILE nom<contador DO
FETCH precio INTO b;
FETCH cantidad INTO c;
SET nom=nom+1;
SET total=total+b*c;
END WHILE;


CLOSE precio;
CLOSE cantidad;
RETURN total;
END$$

